  \"GHRSST Level 3C America Regional Subskin Sea Surface Temperature from the Geostationary
  Operational Environmental Satellites (GOES) Imager on the GOES-13 satellite (GDS
  version 2)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:18.990817\",\n\t\"name\":
  \"ghrsst-level-3c-america-regional-subskin-sea-surface-temperature-from-the-geostationary-op\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A regional Group for High Resolution Sea
  Surface Temperature (GHRSST) Level 3 Collated (L3C) dataset for the America Region
  (AMERICAS) based on retrievals from the GOES-13 Imager on board GOES-13 satellite.
  This particular dataset is produced twice a day over South and North America region
  in the framework of the European Organization for the Exploitation of Meteorological
  Satellites (EUMETSAT) Ocean and Sea Ice Satellite Application Facility (OSI SAF)
  in France.The Geostationary Operational Environmental Satellites (GOES) operated
  by the United States National Oceanographic and Atmospheric Administration (NOAA)
  support weather forecasting, severe storm tracking, meteorology and oceanography
  research. Generally there are several GOES satellites in geosynchronous orbit at
  any one time viewing different earth locations including the GOES-13 launched 24
  May 2006. The radiometer aboard the satellite, The GOES N-P Imager, is a five channel
  (one visible, four infrared) imaging radiometer designed to sense radiant and solar
  reflected energy from sampled areas of the earth. The multi-element spectral channels
  simultaneously sweep east-west and west-east along a north-to-south path by means
  of a two-axis mirror scan system retuning telemetry in 10-bit precision. The OSI-SAF
  SST processing chain for geostationary satellite will ingest the GOES13 Imager radiometric
  data in full time (every 30 minutes) and space resolution, then the NWC (nowcasting)
  SAF cloud mask is applied. GOES-E algorithm (nighttime only) and its correction
  are applied. Due to the lack of 12 &#956;m channel in the GOES-Eimager, there are
  no SST in daytime conditions. The operational products are then produced by remapping
  over a 0.05 degree regular grid SST fields obtained by aggregating all SST data
  available in one hour time, and the priority being given to the value the closest
  in time to the product nominal hour. This dataset produced adheres to the GHRSST
  Data Processing Specification (GDS) version 2 format specifications.\",\n\t\"license_title\":
